import React from 'react';
import logo from './logo.svg';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import './CoachLive.css';




function Header() {
  return (
    <Container fluid id="headerDiv">
      <span id="studentTag">Coaching:</span>
      <img src="logo.png" id="studentHeader" />
      <span id="studentUsername">Student Username </span>
    </Container>
  );
}

function Body() {
  return (
    <Row>
      <Col xs={6} id="statsSide"><Stats /></Col>
      <Col xs={6} id="mapSide">Hello</Col>
    </Row>
  )
}


function Stats() {
  return (
    <Container id="statsContainer">
      <Row>
        <Col xs={3} id="webButton"><button>Stat Website</button></Col>
        <Col xs={3} id="tabButton"> Hello!</Col>
      </Row>
      <Row>
        Hello
      </Row>
    </Container>
  );

}




export default function LiveCoachView() {
  return(
    <Container fluid="xs">
      <Row>
        <Header />
      </Row>
      <Body />
    </Container>
  );
}
